elements.expression:
filters
| essql 
  query="SELECT beats_state.beat.version AS beat_version, COUNT(DISTINCT(beats_state.beat.name)) AS beat_name FROM \".monitoring-beats*\" WHERE beat_version IS NOT NULL AND NOT beats_state.beat.type='apm-server' GROUP BY beat_version"
| markdown 
  "{{#each rows}}
 {{beat_name}} Beat(s) is/are running {{beat_version}}  
{{/each}}" 
  font={font family="'Gill Sans', 'Lucida Grande', 'Lucida Sans Unicode', Verdana, Helvetica, Arial, sans-serif" size=18 align="left" color="#FFFFFF" weight="normal" underline=false italic=true}
| render

esdocs index="*beat-7*" fields="host.os.name" query="_exists_:mitre.technique.name" sort="@timestamp, DESC"
| dropdownControl valueColumn="host.os.name" filterColumn="host.os.name" filterGroup="noml"
| render containerStyle={containerStyle opacity="0.5"}

esdocs index="*beat-7*" fields="agent.hostname" query="_exists_:mitre.technique.name" sort="@timestamp, DESC"
| dropdownControl valueColumn="agent.hostname" filterColumn="agent.hostname" filterGroup="noml"
| render containerStyle={containerStyle opacity="0.5"}

